import React from 'react'

const Community = () => {
    const channelslist = ["1", "2", "3", "4", "5", "6", "7", "8"]
  return (
    <div>
        <section className='bg-slate-500 h-[100vh] max-w-[250px]' flex flex-col>
            <div className='flex justify-center items-center'>Channels</div>
            <Channels channelslist={channelslist}/>
        </section>
        <div className='flex justify-between sticky bottom-0'>
        <text-area> type='' className='flex justify-end items-baseline  w-full h-14  p-5 text-xl'></text-area>
        <button className='text-black border border-black w-20 bg-white'>Send</button>
        </div>
    </div>
  )
}

export default Community

const Channels = ({channelslist}) => {
    return (
        channelslist.map((channel) => { 
            return (
                <Channel channeldata={channel}/>    
            )
        }
        )

    )
}

const Channel = ({channeldata}) => {
    return (
        <div className='text-white border border-slate-700 h-12 flex justify-center items-center'>
            {channeldata}
        </div>
    )
}
